import react from 'react'
import { Link, useNavigate } from 'react-router-dom'
import axios from 'axios'
import React, { useEffect, useState ,ReactDOM} from 'react';
import Button from 'react-bootstrap/Button';
import { createRoot } from 'react-dom/client';
//mport * as ReactDOM from 'react-dom/client';
import RequestList from '../components/RequestList';


export default function Admin(){

    const [isLoading, setLoading] = useState(false);
    const [apiResponse,setapiResponse] = useState("");


    useEffect(() => {
        if (isLoading) {
            console.log("req sent")
            axios.get("http://localhost:8000/api/admin/requests")
            .then((Response)=>{
                console.log(Response.data);
                setapiResponse(Response.data);
                setLoading(false);
                  // React.createElement(<h1> hello2</h1>
                // console.log(req)
                // document.getElementById('req').appendChild(req);
                //ReactDOM.render(req,document.getElementById('req'))
            })
            .catch((e)=>console.log(e)) 
        }
      }, [isLoading]);
    
      const handleClick = () => {
        setLoading(true);
        document.getElementById('requests').style.display ="block";
      }
        
    return(
        <React.Fragment>
            <section className="header">
                <div className="logo">ImageR</div>
                

                <div className="search-bar">
                    <img className="search-icon" alt="" src="data:image/svg+xml;utf8;base64," />
                    <input className="search" placeholder="Search" type="text" />
                    <img className="clear-icon" alt=""src="data:image/svg+xml;utf8;base64," />
                </div>

                <div className="right-align">
                    <Link to="/Login"><button className="small var2 normal">Log out</button></Link>
                </div>
            </section>

            <section className="requests">
                <h1 className='reqH1'>Requests</h1>
                <Button className="reqbutton" size="lg" variant="light" disabled={isLoading}
                    onClick={!isLoading ? handleClick : null} >
                     {isLoading ? 'Loadingâ€¦' : 'Click to load'}
                </Button>{' '}


                
            </section>
            <div id='requests'>
                {RequestList(apiResponse)}
                        
            </div>
               
        
        </React.Fragment>

    )
}